import React from "react";

const Radar = ({droneData}) => {
    var c = document.getElementById("radarCanvas");
    var ctx = c.getContext("2d");
    ctx.moveTo(0, 0);
    ctx.lineTo(200, 100);
    ctx.stroke();


    const canvasStyle = {
        border : '1px',
        border : 'solid'

    }
    return(
        <canvas id="radarcanvas" width="250" height="250" style={canvasStyle}>

        </canvas>
    )
}


export default Radar;
